// Get all releases
export function getAllRevReleases(): RevRelease[] {
  return revDiscography;
}

// Get releases by year
export function getRevReleasesByYear(year: number): RevRelease[] {
  return revDiscography.filter((r) => r.year === year);
}

// Get release by catalog number
export function getRevReleaseByCatalogNumber(num: number): RevRelease | undefined {
  return revDiscography.find((r) => r.catalogNumber === num);
}

// Get unique years
export function getRevReleaseYears(): number[] {
  return [...new Set(revDiscography.map((r) => r.year))].sort((a, b) => a - b);
}

// Get unique artists
export function getRevArtists(): string[] {
  return [...new Set(revDiscography.map((r) => r.artist))].sort();
}

// Get releases by artist
export function getRevReleasesByArtist(artist: string): RevRelease[] {
  return revDiscography.filter((r) => r.artist.toLowerCase().includes(artist.toLowerCase()));
}
